@rasmuselling @runeheiberg Jeg hopper af twitter nu. 

Lad mig slutte med i det mindste at slå et slag for, det skal være valgfrit for de studerende, om de gider deltage eller ej, og at det ikke skal lægge dem til gene, hvis de hellere vil følge faget næste år. 

Ingen skal tvinges e-undervisning.
